import './App.css';
import ReactPlayer from 'react-player';

function App() {
  return (
    <div className="App">
      <div className="Player">
      <ReactPlayer
      url="https://www.youtube.com/watch?v=1tm4ZQHFsk8"
      controls="YouTube" />
      </div>
    </div>
  );
}

export default App;
